      SELECT 45 AS col1 FROM tab0 (FORMAT parquet) WHERE ( NULL ) BETWEEN col2 AND ( - col2 ) * + col1 + - ( CAST ( NULL AS INTEGER ) ) * col1;
  - name: tab0

outputs:
  - name: q5786.out
    data: |
